export const ADD_OPEN_TASK=  '[taskToClass] SET_PROMPTS';


export const updateClasses = (payload) =>({
  type: UPDATE_CLASSES,
  payload
})

export const setDeadLine = (payload) =>({
  type: SET_DEADLINE,
  payload
})

export const setPrompts = (payload) =>({
